import InputAnnotation from "../components/atoms/InputAnnotation/InputAnnotation";

const meta: Meta<typeof InputAnnotation> = {
  title: "Atoms/InputAnnotation",
  component: InputAnnotation,
  tags: ["autodocs"],
  argTypes: {
    text: { control: "text" },
  },
};

export default meta;

type Story = StoryObj<typeof InputAnnotation>;

export const Default: Story = {};
